<!DOCTYPE html>
<html>

<head>
  <meta charset="utf-8">
  <meta name="viewport" content="width=device-width">
  <title>replit</title>
  <link href="style.css" rel="stylesheet" type="text/css" />

  <script src="https://code.jquery.com/jquery-3.6.0.min.js"></script>
</head>

<body>
  <h1> Guided Track Test Page</h1>
  <div class="guidedtrack program_container" id="4459wnh" data-environment="production" >
    <div id="program_navigation" role="banner">
      <div id="back-button"></div>
      <div class="navigation_container" role="navigation"></div>
      <div id="run-menu" role="navigation"></div>
      <div class="points" role="complementary" aria-label="points" aria-live="assertive">
        <div class="total"></div>
        <div class="change"></div>
      </div>
    </div>
    <div class="maintain" role="status" aria-label="note" aria-live="polite"></div>
    <div class="main" role="main" aria-live="polite" aria-live="polite"></div>
  </div>
  <script src="script.js"></script>

  <!--
  This script places a badge on your repl's full-browser view back to your repl's cover
  page. Try various colors for the theme: dark, light, red, orange, yellow, lime, green,
  teal, blue, blurple, magenta, pink!
  -->
  <script src="https://replit.com/public/js/replit-badge-v2.js" theme="dark" position="bottom-right"></script>
</body>

</html>
